// BackgroundImage.js
import React from 'react';

function BackgroundImage() {
  const backgroundImageStyle = {
    backgroundImage: `url('./FAM.png')`,
    backgroundPosition: 'right bottom', // Positionera till höger nedre hörnet
    backgroundSize: 'contain', // Se till att bilden täcker området
    position: 'absolute', // Använd absolut positionering
    width: '50%', // Ställ in önskad bredd
    height: '50%', // Ställ in önskad höjd
    right: 0, // Positionera mot högerkanten
    bottom: 0, // Positionera mot nederkanten
  };

  return <div style={backgroundImageStyle}></div>;
}

export default BackgroundImage;
